  false,\n\t\"url\": null,\n\t\"notes\": \"This is a MD iMAP hosted service layer.
  Find more information at http://imap.maryland.gov. Maryland -  through its Coastal
  Zone Management (CZM) Program -  is collecting information on how the public uses
  the Chesapeake Bay waters and adjacent lands. These baseline data will inform planning
  efforts being undertaken by the Maryland Department of Natural Resources to help
  inform public access -  land acquisition -  and future oyster aquaculture planning
  and decision-making. Collecting data on the variety of ways our Chesapeake waters
  are used will help us plan for reducing use conflicts in our coastal waters -  maximizing
  efficiency -  and enhancing environmental and economic productivity. Chesapeake
  Bay waters are used in many ways: commercial fishing -  aquaculture -  transport
  -  habitat for wildlife -  and recreation -  among others. With new and expanding
  coastal and marine uses -  as well as Maryland's growing coastal population -  the
  pressure is mounting to ensure that there is space for both traditional and new
  uses and that conflicts are minimized. Some mapped human use data exist -  but Maryland
  has limited recreational water use data for the Chesapeake waters. Basic data on
  how we use our coastal waters was collected by inviting residents and experts to
  share their knowledge about recreational uses at workshops using geographical information
  systems technology. Last Updated:  07/01/2014 Feature Service Layer Link: http://geodata.md.gov/imap/rest/services/Society/MD_RecreationalUses/FeatureServer/19
